import ICON from "../../../Icons/plus-svgrepo-com.svg";

export default function TodoList({ todos,setTodos }){
    return (< ol className="todo_list">
    {todos && todos.length > 0 ? (
        todos?.map((item,index) => <Item key={index} item={item} setTodos={setTodos}/>)
    ):(
    <p> Seems lonely here!!</p>
    )}
    </ol>
    );
}

function Item({item}){
    return(
        <li id="item?.id" className="to_do">
            <button className="todo_left">
                <svg>
                <circle cx="11.998" cy="11.998" fillRule="nonzero" r="9.998" />
                </svg>
                <p>{item?.title}</p>
                </button>
            <div className="todo_edit">
                <button>
            <span className="visually-hidden">Edit</span>
            <img src ={ICON} className="icon">

            </img>
            </button>
            <button>
            <span className="visually-hidden">Delete</span>
            
            </button>
            </div>
        </li>
    );

}
